I løbet af årene har jeg brugt mange timer på at køre flere tusinde kilometer, på cykel, på de danske landeveje. Det har ført mig rundt omkring blandt andet til Skjern, Ringkøbing, Ikast, Varde, Bramming, Vejle, Gludsted, Silkeborg, Odense, Ribe og endda helt til Tyskland. På nogle af turene har jeg taget nogle billeder, som du kan se <a href=\"http://kennethclemmensen.test/billeder/\">her</a>.','Velkommen','','publish','closed','closed','','velkommen','','','2017-06-02 17:39:14','2017-06-02 15:39:14','','0','http://kennethclemmensen.test/?page_id=19','0','page','','0'),('20','2','2017-05-24 19:34:04','2017-05-24 19:34:04','Velkommen til min hjemmeside som jeg har lavet, mens jeg har gået på hovedforløbet, som webintegrator, i Odense. På denne side vil der blandt andet være links til opgaver, som jeg har lavet på hovedforløbet, og nogle scripts som du kan downloade og bruge på din hjemmeside.

