I denne kategori er der links til sider, som jeg har lavet for andre.</p>','Links','','publish','closed','closed','','links','','','2018-08-30 16:57:37','2018-08-30 14:57:37','','0','http://kennethclemmensen.test/?page_id=33','0','page','','0'),('34','2','2017-05-25 10:13:16','2017-05-25 08:13:16','Her har jeg samlet links til sider, som jeg har lavet.','Links','','inherit','closed','closed','','33-revision-v1','','','2017-05-25 10:13:16','2017-05-25 08:13:16','','33','http://kennethclemmensen.test/2017/05/25/33-revision-v1/','0','revision','','0'),('35','2','2017-05-25 10:13:40','2017-05-25 08:13:40','Jeg hedder Kenneth Clemmensen, og jeg er født den 24. november 1989. Jeg gik på Syddansk Erhvervsskole i Odense på hovedforløbet som webintegrator. Jeg har taget grundforløbet som mediegrafiker i Kolding, men jeg stoppede, fordi jeg havde mistet min interesse for det. Så begyndte jeg på grundforløbet som webintegrator, da jeg elsker at lave hjemmesider.

Noget af min fritid bruger jeg på at cykle, da jeg elsker at få set mig omkring og ikke mindst at få en masse frisk luft efter at have siddet ved en computer hele dagen. Jeg har cyklet mange tusinde kilometer rundt omkring i Danmark, og et par kilometer i Tyskland, og taget nogle billeder, som du kan se <a href=\"http://kennethclemmensen.test/billeder\">her</a>. Udover at cykle bruger jeg også lidt af min fritid på at se forskellige tv-serier. Blandt andet Friends, Krøniken, Rejseholdet og Hotellet. Et par timers bowling bliver det også til en gang imellem.','Om mig','','publish','closed','closed','','om-mig','','','2017-06-10 17:43:00','2017-06-10 15:43:00','','0','http://kennethclemmensen.test/?page_id=35','0','page','','0'),('36','2','2017-05-25 10:13:40','2017-05-25 08:13:40','Jeg hedder Kenneth Clemmensen, og jeg er født den 24. november 1989. Jeg gik på Syddansk Erhvervsskole i Odense på hovedforløbet som webintegrator. Jeg har taget grundforløbet som mediegrafiker i Kolding, men jeg stoppede, fordi jeg havde mistet min interesse for det. Så begyndte jeg på grundforløbet som webintegrator, da jeg elsker at lave hjemmesider.

