Noget af min fritid bruger jeg på at cykle, da jeg elsker at få set mig omkring og ikke mindst at få en masse frisk luft efter at have siddet ved en computer hele dagen. Jeg har cyklet mange tusinde kilometer rundt omkring i Danmark, og et par kilometer i Tyskland, og taget nogle billeder, som du kan se <a href=\"http://kennethclemmensen.test/billeder\">her</a>. Udover at cykle bruger jeg også lidt af min fritid på at se forskellige tv-serier. Blandt andet Friends, Krøniken, Rejseholdet og Hotellet. Et par timers bowling bliver det også til en gang imellem.','Om mig','','inherit','closed','closed','','35-revision-v1','','','2017-06-10 17:43:00','2017-06-10 15:43:00','','35','http://kennethclemmensen.test/2017/06/10/35-revision-v1/','0','revision','','0'),('1594','2','2017-09-14 19:37:39','2017-09-14 17:37:39','Turen til Fyn viser billeder fra min cykeltur fra Kolding til Middelfart den 24. september 2008.

